INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (24001, 40011, 1, 0, 322, 1, 126001, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 2);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (24001, 40011, 1, 0, 323, 1, 126101, 3, "んーと。\nこれ、あげる。\nはい", "プレシア", 2);
