INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (24001, 40011, 1, 0, 325, 2, 126001, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 2);
